import logo from './logo.svg';
import NavBar from './components/NavBar';
import './App.css';
// 1. import `ChakraProvider` component
import { ChakraProvider } from '@chakra-ui/react';

function App({ Component }) {
  return (
    <ChakraProvider>
      <Component />
      <NavBar />
    </ChakraProvider>
  );
}

export default App;
